import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';

import TodoBody from './containers/todoBody';

class App extends Component {
  render() {
    const App = () => (
        <Switch>
          <Route exact path='/' component={TodoBody}/>
        </Switch>
    )
    return (
      <Switch>
        <App/>
      </Switch>
    );
  }
}

export default App;
